Template.certificate.rendered = function() {
    var currUser = Meteor.users.findOne({ _id: Meteor.userId() });
    if (currUser != undefined || currUser != null) {
        if (currUser.certificateNotification === 'detailsSubmitted') {
            Session.set("activeSection", "certificateView");
        } else {
            Session.set("activeSection", "addCertificateDetails");
        }
    } else
        Session.set("activeSection", "addCertificateDetails");
}

Template.certificate.helpers({
    activeSection: function() {
        return Session.get("activeSection");
    }
});

Template.addCertificateDetails.rendered = function() {
    document.title = "Add Certificate Details - Journey 2 English";

}

Template.addCertificateDetails.helpers({

    getDates: function() {
        var dates = [];
        for (var i = 1; i <= 31; i++) {
            dates.push(i);
        }
        return dates;
    },

    getMonths: function() {
        var months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
        return months;
    },

    getYears: function() {
        var years = [];
        for (var i = 1900; i <= 2018; i++) {
            years.push(i);
        }
        var yearsRev = years.reverse();
        return yearsRev;
    }


});

Template.addCertificateDetails.events({

    'click *[data-function="clear-form"]': function(evt) {
        if (!confirm('Are you sure you want to clear this form?')) return;
        $(':input').not(':button, :submit, :reset, :hidden, :checkbox, :radio').val('');
        $('input[type=date]').val('');
        $(':checkbox, :radio').prop('checked', false);
        Bert.alert('Form cleared', 'success', 'growl-top-right');
    },

    'click *[data-function="submit-details"]': function(evt) {
        evt.preventDefault();
        //var firstname =  $("#firstname").val().trim();
        //firstname = firstname.charAt(0).toUpperCase() + firstname.substring(1); 
        //var surname =  $("#surname").val().trim();
        //surname = surname.charAt(0).toUpperCase()  + surname.substring(1); 
        var email = $("#email").val().trim();
        var firstName = $("#fname").val().trim();
        var lastName = $("#lname").val().trim();
        var userGender = $('input[name="gender"]:checked').val();
        firstName = firstName.replace(/\b\w/g, function(l) { return l.toUpperCase() })
        lastName = lastName.replace(/\b\w/g, function(l) { return l.toUpperCase() })
            //var dateofbirth = $('#dob').val().trim();

        var dayOfBirth = $('#dayOfBirth').val().trim();
        var monthOfBirth = $('#monthOfBirth').val().trim();
        var yearOfBirth = $('#yearOfBirth').val().trim();

        switch (monthOfBirth) {
            case "January":
                monthOfBirth = "01";
                break;
            case "February":
                monthOfBirth = "02";
                break;
            case "March":
                monthOfBirth = "03";
                break;
            case "April":
                monthOfBirth = "04";
                break;
            case "May":
                monthOfBirth = "05";
                break;
            case "June":
                monthOfBirth = "06";
                break;
            case "July":
                monthOfBirth = "07";
                break;
            case "August":
                monthOfBirth = "08";
                break;
            case "September":
                monthOfBirth = "09";
                break;
            case "October":
                monthOfBirth = "10";
                break;
            case "November":
                monthOfBirth = "11";
                break;
            case "December":
                monthOfBirth = "12";
                break;
        }

        var newDateOfBirth = dayOfBirth + "/" + monthOfBirth + "/" + yearOfBirth;

        //var dob = new Date(dateofbirth);

        var date = new Date();
        var completeDateCPD = date.getDate() + '/' + (date.getMonth() + 1) + '/' + date.getFullYear();

        var dateOptions = { year: 'numeric', month: 'long', day: 'numeric' };
        var completeDateCG = date.toLocaleDateString("en-GB", dateOptions);

        var userDetails = { fname: firstName, lname: lastName, email: email, dateofbirth: newDateOfBirth, gender: userGender, issuedateCPD: completeDateCPD, issuedateCG: completeDateCG };
        Session.set("userDetails", userDetails);

        // if (firstname == '' || surname == '' || email == '') {
        //     Bert.alert("Please provide all details!", 'danger', 'growl-top-right');
        //     return false;
        // } 

        if (firstName == '' || lastName == '' || email == '' || userGender == '') {
            Bert.alert("Please provide all details!", 'danger', 'growl-top-right');
            return false;
        }

        var regExpEmail = /\S+@\S+\.\S+/;
        if (!regExpEmail.test(email)) {
            Bert.alert("Please provide a valid email", 'danger', 'growl-top-right');
            return;
        }
        var regExp = /^[a-z\s]+$/i;
        //var regExp = /^[^a-z\x00-\x7F]+$/i; //used for non-English letters
        // if(!regExp.test(firstname)){
        //     Bert.alert("Please provide a valid name", 'danger', 'growl-top-right');
        //     return;
        // }
        // if(!regExp.test(surname)){
        //     Bert.alert("Please provide a valid surname", 'danger', 'growl-top-right');
        //     return;
        // }
        if (!regExp.test(firstName)) {
            Bert.alert("Please ensure that all characters in your name are in English alphabet.", 'danger', 'growl-top-right');
            return;
        }

        if (!regExp.test(lastName)) {
            Bert.alert("Please ensure that all characters in your name are in English alphabet.", 'danger', 'growl-top-right');
            return;
        }

        if (newDateOfBirth.includes("Day") || newDateOfBirth.includes("Month") || newDateOfBirth.includes("Year")) {
            Bert.alert("Please provide a valid date of birth.", 'danger', 'growl-top-right');
            return;
        }

        if (!$('#certConsent').prop('checked')) {
            Bert.alert("You must tick the box at the bottom to receive the certificate.", 'danger', 'growl-top-right');
            return;
        }

        //var day = dob.getDate();
        // var month = dob.getMonth() + 1;
        // var year = dob.getFullYear();
        // if(year < 1900 || year > 2018 || day < 0 || day > 31 || month < 1 || month > 12){
        //     Bert.alert("Please provide a valid date of birth", 'danger', 'growl-top-right');
        //     return;
        // }
        $('#confirmDetails').modal();
        //$('#confirmDetails')
        //Session.set("activeSection", "certificateView");

    },

});

