Template.certificateView.helpers({
    // firstname: function(){
    //     return  Session.get("userDetails").firstname;
    // },

    // surname: function(){
    //     return  Session.get("userDetails").surname;
    // },

    fullName: function() {
        var currUser = Meteor.users.findOne({ _id: Meteor.userId() });
        var name = '';
        if (currUser != null && currUser != undefined)
            name = currUser.certificateDetails.fname + " " + currUser.certificateDetails.lname;
        return name;
    },

    email: function() {
        var currUser = Meteor.users.findOne({ _id: Meteor.userId() });
        var email = '';
        if (currUser != null && currUser != undefined)
            email = currUser.certificateDetails.email;
        return email;
    },

    dateofbirth: function() {
        var currUser = Meteor.users.findOne({ _id: Meteor.userId() });
        var dateofbirth = '';
        if (currUser != null && currUser != undefined)
            dateofbirth = currUser.certificateDetails.dateofbirth;
        return dateofbirth;
    },

    issuedate: function(param) {
        var currUser = Meteor.users.findOne({ _id: Meteor.userId() });
        var issuedate = '';
        if (currUser != null && currUser != undefined) {
            if (param == "cpd") {
                issuedate = currUser.certificateDetails.issuedateCPD;
            } else if (param == "cg") {
                issuedate = currUser.certificateDetails.issuedateCG;
            }

        }

        return issuedate;
    }
});

